  // { "id": "1561", "minerals": ["Cassiterite"], "localityTag": "spain_penouta_mines", "purchaseDate": "Mar 21, 2023", "purchasePrice": "USD 5.5", "details": "Dimensions: 2.4 cm (width) x 1.6 cm (height) x 2.7 cm (thick). Specimen Weight: 12.3 g. From the Alan Noble collection. Alan Noble is a geologist/mining engineer specializing in ore reserve mapping.  He has worked and collected at many mines around the western US including Pinto Valley in Arizona, where very few specimens seem to have survived.  He also spent several years in Spain working at several mines, most notably the Boinas Mine where he collected native copper and malachite, and the Las Cruces Mine where he collected some very nice chalcocite and djurleite specimens.  Alan also accumulated a nice general collection including an impressive suite of fluorite from various localities." },
  // { "id": "1559", "minerals": ["Diaspore V-Twin"], "localityTag": "turkey_selcuk", "purchaseDate": "Mar 15, 2023", "purchasePrice": "USD 41", "details": "A really nice large thumbnail/toenail of gem twinned diaspore.  This deposit in Turkey has produced what are far and away the best examples of the species.  This is an older example, from before the recent finds, and very hard to get.  No damage and well terminated, though one arm has a more complex termination than the other.  This one is much larger than most examples of the material that average about a cm in maximum dimension.  Transparent with a beautiful silky luster.  The labeled Perky box is included. Measures 2.7cm by 1.9cm by 1.4cm" },
  // { "id": "1558", "minerals": ["Topaz"], "localityTag": "russia_murzinka", "purchaseDate": "Mar 15, 2023", "purchasePrice": "USD 27.51", "details": "A nice natural blue topaz specimen from recent (2000) finds at this classic locality.  While commonly seen in jewelry, almost all blue topaz is created through artificial treatment.  Natural blue topaz is quite rare and usually more green than blue.  This is a pure sky blue and 100% natural.  The front and back sides, along with the termination are sharply formed while the sides have been naturally etched.  No damage and almost entirely gem.  The attached base is included,  A great deal on a hard to find classic gem crystal! Measures 3.3cm by 2.9cm, by 2.3 cm" },
  // { "id": "1557", "minerals": ["Fluorite Spinel Twin"], "localityTag": "africa_namibia_erongo", "purchaseDate": "Mar 15, 2023", "purchasePrice": "USD 47.51", "details": "This is a really nice large thumbnail of spinel-law twinned fluorite from the famous pegmatites of the Erongo Mountains in Namibia.  The twinning in this specimen has resulted in an extremely flattened pseudohexagonal shape.  This style of twinning is quite uncommon in fluorite and this is a good example with some unique color zoning.  Complete all around with no damage.  There is a little quartz crystal attached as a bonus.  Labeled Perky box is included. Measures 2.8cm by 2.3cm by 0.4cm" },
  // { "id": "1556", "minerals": ["Pink Grossular Garnet"], "localityTag": "mexico_sierra_de_cruces", "purchaseDate": "Mar 15, 2023", "purchasePrice": "USD 20.5", "details": "A nice large miniature of raspberry pink grossular crystals lining a vug from Sierra de Cruces in Mexico.  These truly unique garnets owe their color to traces of manganese.  Another one of those items that used to be fairly common, but are now hard to get in good examples. This is a good one! See photos for condition. Measures 5.2cm by 2.6cm by 3.8cm.  Largest crystal is 1.4cm across." },
